            <p>Hieronder bieden wij u het gevraagde overzicht van relevante acties tussen <strong>${this.dateFilterRange.from.toFormat("dd/MM/yyyy",{locale:this.language})}</strong> en <strong>${this.dateFilterRange.to.toFormat("dd/MM/yyyy",{locale:this.language})}</strong> die werden uitgevoerd op Vitalink FHIR gelinkt aan uw rijksregisternummer zijnde: <strong>${this.patientSsin}</strong>.</p>
