            <p>Gelieve contact op te nemen via mail: <a href="vitalink@vlaanderen.be">vitalink@vlaanderen.be</a> indien u nog bijkomende vragen heeft of bezoek onze website <a href="www.vitalink.be">www.vitalink.be</a>.</>
